(57, 'http://www.lordsoflords.com/eidolon/stats.php', '19 Aug 2008 09:08:55', 'Hi there... don\\\'t want to be a bother, but I did feel the need to report that the user \\\"duke kingkong\\\" was making some rather inappropriate remarks, insulting me for my vocabulary, assuming I was a small child trying to use large words, inferring that I was promiscuous and repeatedly telling me to \\\"get back under his desk\\\", after telling me that they think I am a 12 year old child.  I found his behaviour both inappropriate and a poor representation of the game.  He also was liberally throwing the word \\\"n00b\\\" around, which I also felt was inappropriate, as well as offensive.  I hope you do take the time to look into this, and perhaps let him know that this behaviour is discouraging new players.', 1219129615),
