(70, 'http://www.lordsoflords.com/meadow2/shop.php', '05 Dec 2008 21:12:10', 'Just an idea, but maybe we could have an option in the layout section or somewhere to check auto accept duels/auto decline duels/ manually accept or decline duels with manual accept decline as default.  That way it would be easier for duellers to find someone more easily and the nonduellers don\\\'t need to worry about cancelling duels often.', 1228507750),
(71, 'http://lordsoflords.com/meadow2/main.php', '15 Dec 2008 21:12:09', 'Mass leveler needed. there needs to be an easier way to  level your character. you should have a combo box (suggesting that you use a certain program to code this of course)\r\n\r\nlike so\r\n\r\ntitle (of stats)    (how much of stat wanted) txt box\r\n               |                  |\r\n               |               |\r\n               |               |\r\n               |               |\r\n               |               |\r\n               |               |\r\n               |               |\r\n\r\n          (how many stat points you have left)\r\n\r\nno more if statements that say if code = this number then you get 1 single level up. thats dumb dude cmon your better then that.', 1229371209),
(72, 'http://www.lordsoflords.com/devlab/main.php?sid=1054026aa8b01ce6bc0502785f31e749', '16 Dec 2008 03:12:29', 'On each persons profile there is a little description about their skills. It has a couple of spelling mistakes.\r\n\r\nVery intelelligent and chooses the mystical power in combat. Spells are not fizzling here. Defending agains a weapon or spell should be no problem. Uses whatever is at hand.\r\n\r\nshould say\r\n\r\nVery intelligent and chooses the mystical power in combat. Spells are not fizzling here. Defending against a weapon or spell should be no problem. Uses whatever is at hand.\r\n\r\nThat\\\'s INTELLIGENT and AGAINST', 1229395949),
