(76, 'http://lordsoflords.com/noauto/main.php?sid=676f2510c796d47ba4bd55e1036bcb77', '16 Jan 2009 05:01:21', 'Hello silent. I have a few very good sudgestions that will help the game. these sudgestions are based on \r\nmy experience with the noauto server.\r\n\r\nnote: make sure you have a good amount of free time, this is a very intricate detailed description of several features this game server should have! this will enhance the whole of all players experiences \r\nhere and will also attract people here. it will also take some time to process and think this over how to \r\ncode this and make it a reality. if all of these are added, it will greately enhance the gaming experience, making it smoother for the player, with more incentive and more fun to play :) i hope you apprecite the hard work i put into these ideas, i also appreciate how well you\\\'ve done with the game over the years, and the decision to expand it, keeping it strong and alive.\r\n\r\nthese are detailed and lengthy,so i will list them as 1:, 2: and so on. organization ftw :) (for the win)\r\n\r\n1: 5 extra charm slots; these slots are after the first 5, and are in a second row under the first 5. \r\nThis would allow an adventurer to use thier main charms without being weakened, while still looking for \r\nbetter charms to use. This would make world much more enjoyable.\r\n\r\n2: in inventory, you have 4 or 5 extra charms that can drop after activating your maximum potion limit. you should be able to see these, but NOT activate them. this allows a player to fight while still looking for potions to replace what\\\'ll be lost, without it being a desperate hunt after potions wear out. \r\n\r\n3: perhaps an option checklist for auto-discard. say, a player runs into 3 int potions 2 magic shield runes and a contrevention potion while fighting.however, the player is a physical warrior, and has no use of such a potion. instead of having to throw them away every single time you find one, which eats most of your play time, a simple checklist of the items that a player wishes to KEEP when found would be implemented, and potions NOT on that list will be automatically discarded. perhaps the message when found could be something like this. you found contravention potion! however, you\\\'ve no use for this and throw it away.\r\n\r\n4&5:\r\nalso, here\\\'s an idea for the prizes on noauto. a special area for prizes, that it will create once \r\nrequirement is achienved, as it could be an automatic process. as credits would be easy to automate once \r\na certain level is achieved, awarded based on 1st/2nd/third etc, and so could CHARMS, based on this \r\nsystem below. PLEASE read this. im not sure how it works now, whether when you reach the level for a prize you must be contacted or what. the only efficient way is to make the process automatic, which sounds hard, considering automatic rewards of gc\\\'s with limited slots sounds like an issue. however, it\\\'s actually quite simple if you use this system. \r\n\r\nif you wanted it to be automated for the gc\\\'s, you could have the game make an extra \\\"special\\\" area for \r\nthese charms, seperate from the extra 5 slots for charms. (see other sudgestion, if non-use storage charm slots are added, this should be the method used) this area would only create as many slots as recieved by the prize. \r\nfor example, say the prize was the 3 gc\\\'s. 3 charm slots aside from the other slots, would appear under \r\nthe other charms, filled with the charms awarded. they would stay there temporarily, until you click the \r\nfollowing options to move them to your main charm inventory. \r\n\\\"move to main charm slots\\\"\r\n\\\"move to unused charm slots\\\" \r\nonce the charm is moved to a main slot, to slot created as a \\\"special\\\" slot, specific for the awarded \r\ncharm, will dissapear. these slots will only appear from an awarded charm/item, with the awarded item in \r\nthat slot, until moved directly to the main inventory.\r\nat that point, the special slot will dissapear. this avoids placing them directly into a possibly full inventory with 10 other charms, preventing them from dissapearing, glitchong, or replacing existing charms; all very bad things.\r\n\r\n6:maybe, a system of auto adjustment of difficulty on a monster. idea: a button that is labeled \\\"adjust\\\" \r\nthat would replace the \\\"difficulty\\\" bar (once coding is tested properly to make sure it works), or be added in somehow, maybe cutdown on the bar length of the monster selection next to fight.anyhow, how this works.\r\nbased on your highest minimum amount physical attack, weapon or attackspell, the auto-adjuster would \r\nmultiply the monster until the difficulty level of the monsters maximum physical/magical defense block+hp was just under the minimal damage of the player. that\\\'s step one. afterwards, it looks at the players attack rating or magic rating; AR if weapon damage is highest, MR if spell damage is highest. from there, it adjusts monster difficulty accordingly as to prevent death because thier rating is too low. this would \r\nadjust the monsters difficulty so that the players minimal rating is just above the monsters maximum \r\nrating of the rating the player uses to attack. this will only adjust difficulty LOWER, never higher, as \r\nthe first check determines how much the player can handle by damage. if it adjusted higher, monster could \r\nblock and player could die. if game didn\\\'t adjust for rating, if player misses a monster it will one hit, \r\nplayer is dead. so, weapon and damage check first, then ratings. this also prevents it from picking the \r\nwrong weapon based on rating. \r\n\r\n example: player has 1.3 million minimum weapon damage. player presses\\\"adjust\\\". game adjusts monster \r\ndifficulty of selected monster until it\\\'s maximum defense block + total hp is just under players damage. \r\nsay, it adjusts it to a level where the monster has 1.297 million between hp+maximum physical block. \r\nTHEN, it looks difficulty is adjusted automatically. the player has for example, 387,346 minimum attack \r\nrating. game adjusts LOWER, matching just under his attack rating so the player does not die by missing. however, if the player had 700,000 rating, it would not adjust the monster difficult over what he could possibly defeat with his weapon. that is determined in the first place to make sure of this, and should be coded so difficulty of monster cannot exceed weapon damage possible difficulty check. in this example, player is a warrior,it would be the same as mage. spell damage>weapon damage, so magic rating will be used to determine to hit monster difficulty.\r\n\r\n7: if automatic awards are implemeted as sudgested, then perhaps there could be special perks to keep \r\npeople playing, having fun, and competing, this will raise player count for sure :) my sudgestion here is \r\nmonthly rewards. such as, at the beggining of the month, each player has a counter for monsters killed \r\nthat month, and ten minutes before the time changes into next month, automatic awards are given to the \r\ntop 3 monster killers. these awards can be automatically given in the form of credits, or in special cases, a month will have a unique reward like an HC or GC, bonus freeplay, bonus automatic credit gain, even a permanant seperate potion that will increase any one selected charm by 15%. say you win #1 spot with 1450k kills and the special reward is that potion, you could increase your god charm by that much;hey, you fought that hard for a month, you earned it! heck, these rewards could even be a permanent stat bonus, or an extra stat point per level gained for the next 2 weeks. there\\\'s quite the potential here, and players would come in to watch or participate to gain unique prizes.\r\ni don\\\'t think levels gained contest would be good, only high level players would win. but monsters killed/month automatic award would be something that could be worked in, and a \\\"special\\\" slot with the \r\npotion for example, would open when awarded inside charm area. you would then have the option to enchant \r\ncharms in main slots 1,2,3,4 or 5. once enchanted, it would be permanent and the potion and special slot \r\nwould dissapear just like charm special slots. this is just a simple example of how to do this if you were woundering. some incentive like credits/charms/charm enhance potion/auto cred gain rewards/awards, would be a very fun way to repopulate and encourage players on this server.these potions should only be monthly reward event prizes though, not buyable. otherwise people with extreme money could run the place and that\\\'s not how it should be, you can buy 5 gc\\\'s and freeplay benifits, the rest should be effort for \r\nreward, and the monthly rewards should be something everyone can do, such as monthly monster kill count! =)\r\n\r\n\r\nsummary.\r\n1: a row of 5 extra charm slots. these charm\\\'s stats are not added to your total. this allows searching \r\nfor new charms without hacving to give up your good ones and having variety in your arsenol.\r\n\r\n2: seeing the extra inventory potions gained,but no option to activate them. this allows to prepare your \r\nnext few potions before the ones currently activated decay. im sure you see the use of this, it is hard \r\nto find a proper potion within half an hour, much less right after it decays.\r\n\r\n3:a checklist page either in inventory, or under it on the main menu bar, under inventory and above charms.\r\nthis checklist would include every possible stat a potion may give. if used, the game would automatically \r\ndiscard any potion found that is not on the checklist. this saves hours of potion deleting and increases the overall effectiveness a gameplay and fun :)\r\n\r\n4:an automatic awards system for credits. when a player achieves/passes level requirements for said prize, game automatically distributes credits based on whether first, second, or third to reach the goal. if all prizes have already been won, no prize is awarded.\r\n\r\n5: automatic charm award system, based on the sudgestion above. seperate \\\"special\\\" charm slot/slots will appear automatically, filled with the charms awarded once the requirement is reached for the award. \r\nnaturally, the awarded charms are based on first/second/third place prizes as listed. as many slots as charms awarded appear, and after moving them to main 5 slots, or the 5 storage charm slots, they \r\ndissapear.\r\n\r\n6: monster auto adjust. this\\\'ll keep the player at max leveling ability,(if they choose to update thier monster levels often enough :P ) and see where his/her weak spots are even better! this will even make it so he/she can pick thier ideal monster to train, with some work on finding it of corse. everyone has thier own playstyle with attack/rating stats, even if they use the same ones as another warrior/mage. \r\nmaximization of training,customization, and curiousity.\r\nmakes for a much more enjoyable gaming experience, but probably the hardest thing to code on this list. \r\nas with everything else, well worth it.\r\n\r\n7: monthly rewards/awards for monster killing, using the same coding as automatic award framework. this \r\nwill draw in players, build community, give incentive to play to be the better slayer and compete in the \r\nfriendly atmosphere we\\\'ve all grown to love.\r\n\r\n\r\ni hope you\\\'ve enjoyed reading this. i also hope your head can absorb all this and make it a reality for us all to enjoy :) this will provide a major update for players to enjoy in a game we already love, i highly look forward to them. it will make the gameplay here flawlessly fun and perhaps, the perfect place to play.\r\n\r\nkeep up the good work and congrats on your real life accomplishments, which i am still very excited about \r\nfor you :) who i am..is a long story. maybe you remember some of it.. i was here nearly 7 years before, helping your admin staff. one of the first to ever play. i unfortunately lost my 5 gc\\\'s, 11000 credits and such when i got too sick to play. much has happened since then, my health has gotten worse in some ways, but i am back and hopefully for good. ill be on on noauto :) if your woundering why i have 2 gc\\\'s, it\\\'s because a friend here ([UC] King Tiroka (1)) allowed me to use them temporarily, they are his. best of luck with life and game feature coding-\r\n\r\nYour friend,\r\nVampx/Vampxreborn/Vampxrebrn\r\n\r\ne-mail: original_vampx@yahoo.com\r\naim: mike000000004\r\nGame:Lol1,Server:Noauto,Charname:Michael\r\nP.S.\r\n[yes, this really is me, and i still have my yim/aim :)] if you wish to contact me over these \r\n\r\nsudgestions, or for anything else, the best way is AIM\r\n(aol instant messanger) as yim doesn\\\'t work very well on my newest computer. second best is my e-mail address.\r\nalso, i made a backup of ths text, as i had been long logged out by the time i had posted this. if there are spacing errors, it\\\'s because i had to paste it all back from a text document. i beleive i fixed them all, but im letting you know why if there are any :) to me, it looks the same as i sent it now. took me 15 more minutes XD', 1232081781),
