(90, 'http://warunit.com/buildings.php?sid=810033e73452d91c275d30f4d5b1838d', '03 Jun 2009 03:06:16', 'Is there a way to automatically adjust the number of troops after each battle if you were to lose any?\r\n\r\nThe numbers doesn\\\'t refresh after losing troops so you would have to refresh your screen to get the right amount or go to population after each battle to replenish your missing units.\r\n\r\nAlso, I believe there should be units that can help in defense against special attacks. For an example:\r\n\r\nThese are the units of the Undead; Gravedigger (Produce Income), Zombie (Intel Units), Skeletons (Offense Unit), Bone Spirits (Defense Unit), Skeltor (Offense/Defense Unit). Each of these class in the army or it doesn\\\'t even have to be all of them has a special ability that reduces the damage you receive from Special attack. Like, Bone Spirits can bolster the defense of Hack, while the Skeletons can bolster the defense of Airstrike. Just an example, but they can only have those ability if you upgrade them.\r\n\r\nAlso, I really see no point of an offense unit and a defense unit when there\\\'s a unit that provides both. The only difference I can see is the upkeep of the Skeltor being only 3 while the other one is 1 and you don\\\'t have to build waste a bunch of units to have both and don\\\'t have to waste money on building all Shrines to increase your population.', 1243993276),
(91, 'http://warunit.com/?sid=bedf3b6d12f65f27d2e3ded98084a254', '03 Jun 2009 23:06:56', 'Also, it would be awesome to have another option other support aside from 500mil Cash and 5k Land. For 100 Credit you can replenish 5k Stealth. It can\\\'t be less as well if you wish. Also, if you buy a bundle package you get a bonus like buying a bundle credit you receive a bonus.\r\n\r\nStealth is the problem with this game thus making it not very attractive to players but if there was a way for some to keep playing even if they have to pay money, I\\\'m positive they would give up a little pocket change just to get extra 1000 or 2500 stealth just to enjoy hunting and attacking.', 1244066156),
