(103, 'http://www.lordsoflords.net/main.php?sid=533358e4290857c1453a5a2124c393ba', '13 Oct 2009 22:10:06', 'Silent,\r\n\r\n\r\nWe have a bug in .NET that would be a great benefit for you to fix. When you are a Super Admin and you try to click the \\\"click here to become admin of your world\\\" on main page it does not work. This has caused many Super Admins to lose their titles from rouge admins and caused them to quit, and the server to die. The only active server is my server, Lost Souls, which is where you get all your money from .NET from.\r\n\r\n\r\nI have had SEVERAL players wanting to buy a world but when they hear there is a chance of losing admin from accidental teleport or rouge admin or hack than they have no desire to buy the world anymore which means YOU LOSE MONEY. I would also like the feature so I am not so insecure about giving out admin.\r\n\r\n\r\n- Admin Draco\r\n\r\n\r\nPS: Also I encourage you to get on Lost Souls server (I can replenish Admin title if you lose it on teleport) and listen to the players suggestions. I recruit MANY people but only some stay due to lack of features. And the suggestions you would get would be easy to put in. PLEASE consider this. It will not only give players a more enjoyable game but would allow you to get a vast increase in income from .NET.\r\n\r\n\r\nPSS: I know you don\\\'t get why people still play this game but its because we like it, it is our thing and we have played it very much. PLEASE LISTEN TO YOUR PLAYERS! IT WILL GREATLY BENEFIT YOU', 1255467066),
